import React, { useState, useEffect } from 'react';

const Logs = () => {

    const [Logs, setLogs] = useState([])
    const [Loading, setLoading] = useState(false)

    useEffect(() => {

        return () => {
            cleanup
        };
    }, [])

    const getLogs = async () => {
        setLoading(true);
        const res = await fetch('/los')
        const data = await res.json()

        setLogs(data)
        setLoading(false)
    }

    if (Loading) {
        return <h4> loading... </h4>
    }

    return (
        <div>
            i am logs
        </div>
    );
};

export default Logs;
